// styles
import "./RightItem.css";

// icons
import { GiBrain } from "react-icons/gi";
import { AiFillSafetyCertificate } from "react-icons/ai";
import { TiHeart } from "react-icons/ti";

const RightItem = () => {
  return (
    <div className="right">
      <h1 style={{marginLeft:"15px", marginTop: "-50px"}}>
        Overall Score: <span>89</span>
      </h1>
      <div className="cards-container">
        <div className="card">
          <TiHeart />
          <p>PATHOS</p>
          <h6>30</h6>
        </div>
        <div className="card">
          <GiBrain />
          <p>LOGOS</p>
          <h6>30</h6>
        </div>
        <div className="card">
          <AiFillSafetyCertificate />
          <p>ETHOS</p>
          <h6>29</h6>
        </div>
      </div>
    </div>
  );
};

export default RightItem;
